def incrementBar(v, f_lbl, x, bar, style):
	global s_frame
	bar['value'] = x
	f_lbl.configure(text=v.get())
	style.configure('text.Horizontal.TProgressbar', background='green', text='{:g} %'.format(x))
	s_frame.update()


def progressVal(x, bar, style):
		#Progressbar style
		style.layout('text.Horizontal.TProgressbar', 
	             [('Horizontal.Progressbar.trough',
	               {'children': [('Horizontal.Progressbar.pbar',
	                              {'side': 'left', 'sticky': 'ns'})],
	                'sticky': 'nswe'}), 
	              ('Horizontal.Progressbar.label', {'sticky': ''})])
		style.configure('text.Horizontal.TProgressbar', text='0 %')
		bar['value'] = x
		bar.pack()


def migratePolicy(policyIDs, src_url, t1_key, dst_url, t2_key):
	global s_frame

	time.sleep(2)
	f_policyIDs = []
	for item in policyIDs:
		if(item.get() == "n"):
			pass
		else:
			f_policyIDs.append(item.get())

	x = 0
	style = ttk.Style()
	bar = ttk.Progressbar(s_frame, length = 200, style='text.Horizontal.TProgressbar')

	v = StringVar()
	v.set("Migrating Policy...")

	blank_lbl1 = Label(s_frame, text="", font=("Arial Bold", 12), justify=CENTER)
	blank_lbl1.pack()

	blank_lbl2 = Label(s_frame, text="", font=("Arial Bold", 12), justify=CENTER)
	blank_lbl2.pack()

	f_lbl = Label(s_frame, text=v.get(), font=("Arial Bold", 10), justify=CENTER)
	f_lbl.pack()

	progressVal(x, bar, style)

	#FUNCTIONS
	antimalwareconfig, allofpolicy = GetPolicy(f_policyIDs, src_url, t1_key)
	x+=2.5
	v.set("Fetching Policy/s on Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	directorylist, fileextentionlist, filelist, allamconfig = AMconfigtenant1(antimalwareconfig, src_url, t1_key)
	x+=2.5
	v.set("Fetching Policy/s on Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	alldirectory = DirListTenant1(directorylist, src_url, t1_key)
	x+=2.5
	v.set("Fetching directories, file lists, file extensions on Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	allfileextention = FileExtensionListTenant1(fileextentionlist, src_url, t1_key)
	x+=2.5
	v.set("Fetching directories, file lists, file extensions on Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)              
	allfilelist = FileListTenant1(filelist, src_url, t1_key)
	x+=2.5
	v.set("Renaming directories, file lists, file extensions on Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	alldirectory, allfilelist, allfileextention = RenameLists(alldirectory, allfilelist, allfileextention)
	x+=2.5
	v.set("Creating new directories, file lists, file extensions on Destination Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	#create each list to tenant 2
	alldirectorynew = DirListTenant2(alldirectory, dst_url, t2_key)
	x+=2.5
	v.set("Creating new directories, file lists, file extensions on Destination Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	allfileextentionnew = FileExtensionListTenant2(allfileextention, dst_url, t2_key)
	x+=2.5
	v.set("Creating new directories, file lists, file extensions on Destination Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	allfilelistnew = FileListTenant2(allfilelist, dst_url, t2_key)
	x+=2.5
	v.set("Cross checking current configuration for Anti-Malware...")
	incrementBar(v, f_lbl, x, bar, style)
	#Check AM Config lists and replace the old one
	allamconfig = AmConfigCheck(allamconfig, directorylist, alldirectorynew, fileextentionlist, allfileextentionnew, filelist, allfilelistnew)
	x+=2.5
	v.set("Renaming Anti-Malware Configuration/s...")
	incrementBar(v, f_lbl, x, bar, style)
	#Rename AM Configs
	allamconfig = RenameAmConfig(allamconfig)
	x+=2.5
	v.set("Creating Anti-Malware Configuration/s in Destination Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	#create AM Configs to tenant 2
	allamconfignew = AmconfigTenant2(allamconfig, dst_url, t2_key)
	x+=2.5
	v.set("Fixing some Anti-Malware Configuration/s...")
	incrementBar(v, f_lbl, x, bar, style)
	#Replace old AM config with new AM config
	allofpolicy = AmReplaceConfig(allofpolicy, antimalwareconfig, allamconfignew)
	x+=2.5
	v.set("Renaming Policy...")
	incrementBar(v, f_lbl, x, bar, style)
	#Rename Policy
	allofpolicy = RenamePolicy(allofpolicy)
	x+=2.5
	v.set("Fetching IP List/s in Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	#IP List transfer
	t1iplistall, t1iplistname, t1iplistid = IpListGet(src_url, t1_key)
	x+=2.5
	v.set("Creating IP List/s in Destination Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	t2iplistid = IpListCreate(t1iplistall, t1iplistname, dst_url, t2_key)
	x+=2.5
	v.set("Fetching MAC List/s in Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	t1maclistall, t1maclistname, t1maclistid = MacListGet(src_url, t1_key)
	x+=2.5
	v.set("Creating MAC List/s in Destination Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	t2maclistid = MacListCreate(t1maclistall, t1maclistname, dst_url, t2_key)
	x+=2.5
	v.set("Fetching Port List/s in Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	t1portlistall, t1portlistname, t1portlistid = PortListGet(src_url, t1_key)
	x+=2.5
	v.set("Creating Port List/s in Destination Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	t2portlistid = PortListCreate(t1portlistall, t1portlistname, dst_url, t2_key)
	x+=2.5
	v.set("Fetching Stateful Configuration/s in Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	#Other transfer
	t1statefulall, t1statefulname, t1statefulid = StatefulGet(src_url, t1_key)
	x+=2.5
	v.set("Creating Stateful Configuration/s in Destination Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	t2statefulid = StatefulCreate(t1statefulall, t1statefulname, dst_url, t2_key)
	x+=2.5
	v.set("Fetching Firewall Configuration/s in Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	#all about Firewall rules
	firewallruleid, policystateful = FirewallGet(allofpolicy)
	x+=2.5
	v.set("Describing Firewall Configuration/s in both Tenants...")
	incrementBar(v, f_lbl, x, bar, style)
	allfirewallrule, allfirewallruleidnew1, allfirewallruleidold, allfirewallcustomrule = FirewallDescribe(firewallruleid, t1iplistid, t2iplistid, t1maclistid, t2maclistid, t1portlistid, t2portlistid, src_url, t1_key, dst_url, t2_key)
	x+=2.5
	v.set("Creating Custom Firewall Rules (if any) in Destination Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	#Create custom Firewall rules
	allfirewallruleidnew2 = FirewallCustom(allfirewallrule, allfirewallcustomrule, dst_url, t2_key)
	x+=2.5
	v.set("Fixing some configurations in Firewall...")
	incrementBar(v, f_lbl, x, bar, style)
	#replace old firewall rule with tenant 2
	allofpolicy = FirewallReplace(allofpolicy, allfirewallruleidnew1, allfirewallruleidnew2, firewallruleid, allfirewallruleidold, allfirewallcustomrule, t1statefulid, t2statefulid)
	x+=2.5
	v.set("Fetching IPS application types in Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	#all about IPS rules
	#find all IPS application ID
	ipsappid = IPSappGet(allofpolicy)
	x+=2.5
	v.set("Describing IPS application types in both Tenants...")
	incrementBar(v, f_lbl, x, bar, style)
	#describe IPS app ID
	allipsapp, allipsappidnew1, allipsappidold, allipscustomapp = IPSappDescribe(ipsappid, t1portlistid, t2portlistid, src_url, t1_key, dst_url, t2_key)
	x+=2.5
	v.set("Creating Custom IPS application types (if any) in Destination Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	#Create custom IPS app
	allipsappidnew2 = IPSappCustom(allipsapp, allipscustomapp, dst_url, t2_key)
	x+=2.5
	v.set("Fixing some IPS application types...")
	incrementBar(v, f_lbl, x, bar, style)
	#replace old ips app with tenant 2
	allofpolicy = IPSappReplace(allofpolicy, allipsappidnew1, allipsappidnew2, ipsappid, allipsappidold, allipscustomapp)
	x+=2.5
	v.set("Fetching IPS Configuration/s in Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	#find all ips rules
	ipsruleid = IPSGet(allofpolicy)
	x+=2.5
	v.set("Describing IPS configuration/s in both Tenants...")
	incrementBar(v, f_lbl, x, bar, style)
	#describe IPS rule
	allipsrule, allipsruleidnew1, allipsruleidold, allipscustomrule = IPSDescribe(ipsruleid, ipsappid, allipsappidnew1, allipsappidnew2, allipsappidold, allipscustomapp, src_url, t1_key, dst_url, t2_key)
	x+=2.5
	v.set("Creating Custom IPS rules (if any) in Destination Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	#Create custom IPS rules
	allipsruleidnew2 = IPSCustom(allipsrule, allipscustomrule, dst_url, t2_key)
	x+=2.5
	v.set("Fixing some IPS configuration/s...")
	incrementBar(v, f_lbl, x, bar, style)
	#replace old IPS rule with tenant 2
	allofpolicy = IPSReplace(allofpolicy, allipsruleidnew1, allipsruleidnew2, ipsruleid, allipsruleidold, allipscustomrule)
	x+=2.5
	v.set("Fetching LI and IM Configuration/s in Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	#all about log rules
	#find all log rules
	liruleid = LIGet(allofpolicy)
	x+=2.5
	v.set("Describing and Creating LI and IM Rules and Configurations...")
	incrementBar(v, f_lbl, x, bar, style)
	#describe log rule
	alllirule, allliruleidnew1, allliruleidold, alllicustomrule = LIDescribe(liruleid, src_url, t1_key, dst_url, t2_key)
	x+=2.5
	v.set("Describing and Creating LI and IM custom rules and configurations...")
	incrementBar(v, f_lbl, x, bar, style)
	#Create custom LI rules
	allliruleidnew2 = LICustom(alllirule, alllicustomrule, dst_url, t2_key)
	#replace old LI rule with tenant 2
	allofpolicy = LIReplace(allofpolicy, allliruleidnew1, allliruleidnew2, liruleid, allliruleidold, alllicustomrule)
	#all about IM rules
	#find all IM rules
	imruleid = IMGet(allofpolicy)
	#describe IM rule
	allimrule, allimruleidnew1, allimruleidold, allimcustomrule = IMDescribe(imruleid, src_url, t1_key, dst_url, t2_key)
	x+=5
	v.set("Finishing Migration...")
	incrementBar(v, f_lbl, x, bar, style)
	#Create custom IM rules
	allimruleidnew2 = IMCustom(allimrule, allimcustomrule, dst_url, t2_key)
	#replace old IM rule with tenant 2
	allofpolicy = IMReplace(allofpolicy, allimruleidnew1, allimruleidnew2, imruleid, allimruleidold, allimcustomrule)
	#Removing proxy configuration
	allofpolicy = ProxyEdit(allofpolicy)
	#create Policy to tenant 2
	AddPolicy(allofpolicy, dst_url, t2_key)
	x+=5
	v.set("Migration done!")
	incrementBar(v, f_lbl, x, bar, style)
	time.sleep(1)

	if (x == 100):
		blank_lbl3 = Label(s_frame, text="", font=("Arial Bold", 12), justify=CENTER)
		blank_lbl3.pack()

		widget_list = all_children(s_frame)

		btn1_submit = Button(s_frame, text="Close", command = lambda: [reset_all()], height=1, width=14)
		btn1_submit.pack()


def migrateST(stIDs, src_url, t1_key, dst_url, t2_key):
	global s_frame

	f_stIDs = []
	for item in stIDs:
		if(item.get() == "n"):
			pass
		else:
			f_stIDs.append(item.get())

	x = 0
	style = ttk.Style()
	bar = ttk.Progressbar(s_frame, length = 200, style='text.Horizontal.TProgressbar')

	v = StringVar()
	v.set("Migrating Scheduled Task/s...")

	blank_lbl1 = Label(s_frame, text="", font=("Arial Bold", 12), justify=CENTER)
	blank_lbl1.pack()

	blank_lbl2 = Label(s_frame, text="", font=("Arial Bold", 12), justify=CENTER)
	blank_lbl2.pack()

	f_lbl = Label(s_frame, text=v.get(), font=("Arial Bold", 10), justify=CENTER)
	f_lbl.pack()

	progressVal(x, bar, style)

	#FUNCTIONS
	x+=10
	v.set("Fetching Scheduled Task/s on Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	time.sleep(3)
	x+=10
	v.set("Fetching Scheduled Task/s on Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	time.sleep(3)
	x+=10
	v.set("Fetching Scheduled Task/s on Source Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	time.sleep(3)
	allst, namest = GetScheduledTask(f_stIDs, src_url, t1_key)
	x+=30
	v.set("Creating Scheduled Task/s on Destination Tenant...")
	incrementBar(v, f_lbl, x, bar, style)
	time.sleep(3)
	CreateScheduledTask(allst, namest, dst_url, t2_key)
	x+=30
	v.set("Finishing Migration...")
	incrementBar(v, f_lbl, x, bar, style)
	time.sleep(3)
